import "./Support.scss";
import { Link } from "react-router-dom";


const Support = () => {
    return (
        <div className="container support">
            <div className="text-zone">
                <h1 className="aligned">Takımımız</h1>
                <h1>için yeni sponsorlar</h1>
                <h1 className="aligned">arıyoruz!</h1>
                <Link to="/sponsor" className="flat-button aligned">Sponsorluk Dosyası</Link>
            </div>
        </div>
    );


}

export default Support;
